description:
The Cardinals - Come Back My Love. This is a three CD greatest hits collection of the Baltimore based doo wop R&amp;B group The Cardinals. The files are a single FLAC + .cue, split FLACs and M4As, as well as scans of the CD insert. I did not rip this, I just made it more convenient to download and enjoy.
